import Layout from '../components/Layout';

const index = () => (
    <div>
        <Layout>
            <h1>Hello world</h1>
        </Layout>

        <style jsx>{`
            div {
                background-image: url("/home_bgi.jpg");
                background-attachment: fixed;
                background-position: center;
                background-repeat: no-repeat;
                background-size: cover;
                min-height: 100vh;
            }
      `}</style>
    </div>
);

export default index;
